import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
    appBar: {
        borderRadius: 15,
        margin: '30 px 0',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',

    },
    heading: {
        color: 'rgba(0,183,255,1)',
    },
    font: {
        display: 'flex',
        justifyContent: 'center',
        fontSize: '3rem',
    },
    image: {
        marginLeft: '15px',
    },
}));
